import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

function Dashboard() {
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const nav = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('authToken');
    if (!token) {
      nav('/signin');
      return;
    }

    const fetchItems = async () => {
      try {
        const res = await axios.get('http://localhost:3001/auctions');
        setItems(res.data);
      } catch (err) {
        console.error('Error fetching auctions:', err);
        setError('Failed to load auctions. Try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchItems();
  }, []);

  // üîπ Logout Function
  const handleLogout = () => {
    localStorage.removeItem('authToken');
    nav('/signin');
  };

  return (
    <div style={styles.container}>
      {/* üîπ Navbar */}
      <div style={styles.navbar}>
        <h2 style={styles.title}>Auction Dashboard</h2>
        <button onClick={handleLogout} style={styles.logoutButton}>Logout</button>
      </div>

      {/* üîπ Post Auction Button */}
      <Link to="/post-auction">
        <button style={styles.postButton}>+ Post New Auction</button>
      </Link>

      {/* üîπ Loading & Error Messages */}
      {loading ? <p style={styles.message}>Loading auctions...</p> : null}
      {error ? <p style={styles.error}>{error}</p> : null}

      {/* üîπ Auction Items */}
      <div style={styles.grid}>
        {items.length > 0 ? (
          items.map((item) => (
            <div key={item._id} style={styles.card}>
              <h3>{item.itemName}</h3>
              <p>Current Bid: <strong>${item.currentBid}</strong></p>
              <p>Status: {item.isClosed ? '‚ùå Closed' : 'üü¢ Open'}</p>
              <Link to={`/auction/${item._id}`} style={styles.viewButton}>
                View Auction
              </Link>
            </div>
          ))
        ) : (
          <p style={styles.message}>No auctions available.</p>
        )}
      </div>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '800px',
    margin: 'auto',
    padding: '20px',
    textAlign: 'center',
    background: '#222',
    borderRadius: '12px',
    color: 'white',
    boxShadow: '0 4px 12px rgba(255, 0, 255, 0.3)',
  },
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingBottom: '10px',
    borderBottom: '2px solid #ff00ff',
  },
  title: {
    fontSize: '1.8rem',
    margin: '0',
  },
  logoutButton: {
    background: '#ff2e2e',
    color: 'white',
    padding: '8px 12px',
    border: 'none',
    borderRadius: '6px',
    cursor: 'pointer',
    fontWeight: 'bold',
    transition: '0.3s',
  },
  logoutButtonHover: {
    background: '#cc0000',
  },
  postButton: {
    marginTop: '15px',
    padding: '10px',
    background: '#ff00ff',
    color: 'white',
    fontSize: '1rem',
    border: 'none',
    borderRadius: '6px',
    cursor: 'pointer',
    fontWeight: 'bold',
    transition: '0.3s',
  },
  grid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '15px',
    marginTop: '20px',
  },
  card: {
    background: '#111',
    padding: '15px',
    borderRadius: '8px',
    boxShadow: '0 3px 10px rgba(255, 0, 255, 0.3)',
    transition: 'transform 0.3s ease',
    textAlign: 'left',
  },
  cardHover: {
    transform: 'scale(1.05)',
  },
  viewButton: {
    display: 'block',
    marginTop: '10px',
    padding: '8px 12px',
    background: '#8000ff',
    color: 'white',
    textDecoration: 'none',
    borderRadius: '6px',
    textAlign: 'center',
    fontWeight: 'bold',
    transition: '0.3s',
  },
  message: {
    color: '#ff6bff',
    marginTop: '10px',
    fontWeight: 'bold',
  },
  error: {
    color: '#ff2e2e',
    marginTop: '10px',
    fontWeight: 'bold',
  },
};

export default Dashboard;
